import React from 'react'
var historyCSS= require('./history.css')
import {Link,BrowserRouter,Route} from 'react-router-dom'
export default class HistoryPage extends React.Component{
    render(){
        return(
            <div className={historyCSS.history}>
            排行榜单 里面都是电影
            <Link to="login"></Link>
            </div>
        )
    }
}
